import styled from "styled-components";


export const style = {
	width: '80%',
	height: '80%'
}

export const ContainerStyle =  {
	position: 'relative',
	width: '80%',
	height: '80%'
}



export const Wrapper = styled.div `
	{	
		font-size: 1em;
		width: 100vw;
		height: 15vh;
        top: 0;
        left: 0;
        text-align: center;
		background: #1f2a32;
		color: #f1f1f1;
	}
`;
